CREATE TRIGGER `trigger_before_insert_files` BEFORE INSERT ON `files` FOR EACH ROW BEGIN 

	/* If no vol_id upon insertion we do either:
		(1) find the volume by name and file_create_date or
	    (2) create custom auto identity column with the form 'vol0001' */
	
	IF NEW.vol_id NOT RLIKE "vol[0-9][0-9][0-9][0-9]" then

		set @vol_id = (select vol_id from files where files.file_create_date = new.file_create_date and files.file_name = new.file_name and files.folder_id = 1) ; 

		if not isnull(@vol_id) then 
			SET NEW.vol_id = @vol_id;  /* could be creating a duplicate entry here.  is okay: this trigger will finish and return vol_id */
		else
			SET NEW.vol_id = concat( 'vol' ,  substr( concat( '0000' , 1 + ifnull( (select max(substr(vol_id,-4)) from files) , 0) ) , -4 ) ) ;
		end if;

	END if;

	/* for return to caller, query "select @vol_id" */
	
	set @vol_id = (select NEW.vol_id) ;  

    /* before insert, these can be zero for a new record or more than one if we are recording modifications. */

	set @count_by_file_name = (select count(*) from files where files.vol_id = new.vol_id and files.folder_id = new.folder_id and files.file_name = new.file_name ) ;

	set @count_by_file_id =   (select count(*) from files where files.vol_id = new.vol_id and files.file_id = new.file_id ) ;

	/* we also calculate these in the after trigger */

	/*	Here is where we update the existing record with the newly inserted data, so we are free (in "after") to delete the *new* inserted record */
	/* okay.  we can't update.  duh.  so accept the error from the after trigger and use this to execute an update from the app level */
	-- Can't update table 'files' in stored function/trigger because it is already used by statement which invoked this stored function/trigger. HY000

	/* update files 
		set  files.file_mod_date = new.file_mod_date, files.file_size = new.file_size
		where files.vol_id = new.vol_id and files.folder_id = new.folder_id and files.file_name = new.file_name; */

	/*set @vol_id = (select files.vol_id from files where files.vol_id = new.vol_id and files.folder_id = 1) ;  */

END;
