CREATE TRIGGER `trigger_after_insert_files` AFTER INSERT ON `files` FOR EACH ROW begin

	set @count_by_file_name = (select count(*) from files where files.vol_id = new.vol_id and files.folder_id = new.folder_id and files.file_name = new.file_name ) ;

	set @count_by_file_id =   (select count(*) from files where files.vol_id = new.vol_id and files.file_id = new.file_id ) ;

	/* we also calculate these in the before trigger */

	/*
		erxr: 1442 (HY000): Can't update (or delete :-) table 'files' in stored function/trigger 
		because it is already used by statement which invoked this stored function/trigger. 
	
		delete from files where files.vol_id = new.vol_id and files.folder_id = new.folder_id and files.file_name = new.file_name
										and files.file_mod_date <= @existing_count2 ;
	*/

	/*	explicit check against an earlier record(s) existing.  Test is here in after trigger so that it only happens if we don't find a duplicate key on insert.
			there will be, of course, at least one.  an earlier record would be >= 2
			we already updated the existing record with the newly inserted data, so we are free to delete the *new* inserted record */

/* donb 2-20-2013  we're going to a simple process here; no modifications at all at the trigger-level.  Any duplicates are useful and
			arekept for a following pass when they cna be considered as the source of an "updated" message to all (relational) dependents of thie originalfie. */
/*
	IF ( select count(*) from files where files.vol_id = new.vol_id and files.folder_id = new.folder_id and files.file_name = new.file_name ) >= 2 THEN
		SIGNAL SQLSTATE '22012';  -- catch this error and then just don't commit?
	END IF;
*/

end;
